import React from "react";
import { Box } from "@mui/material";
import Grid from "@mui/material/Grid2"; // Import new Grid2 API
import img1 from "../../assets/s1.jpg";
import "./category.style.scss";
const Category = () => {
  return (
    <Box sx={{ flexGrow: 1 }} className="categoryContainer">
      <Grid container spacing={1}>
        <Grid
          size={{ xs: 12, md: 6, sm: 6, lg: 6 }}
          className="firstGridContainer"
        >
          jhgjhxwvf
        </Grid>
        <Grid
          size={{ xs: 6, md: 4, sm: 6, lg: 6 }}
          className="secondGridContainer"
        >
          <img src={img1} alt="212" style={{ width: "100%" }} />
        </Grid>
      </Grid>
    </Box>
  );
};

export default Category;
